!***********************************************************************
!   System:                     O3
!   Functional form:            permutation restrained diabatization by
!                               deep neural network
!   Common name:                O3_14_3Ap_2023a (14 quintet A' states)
!   Number of derivatives:      first derivatives of adiabatic surfaces
!   Number of bodies:           3
!   Number of surfaces:         14
!   Notes:                      -Diatomic potentials contain dispersion terms
!                               -Compile the subroutine requires LAPACK
!                                subroutine DSYEV
! 
!   Input:                      Cartesian coordinates in bohr
!   Output:                     Adiabatic energies (e) in hartrees,
!                               derivatives of adiabataic energies (g) in
!                               hartrees/bohr, and NACs (h) in inverse bohrs.
!   Reference:
!***********************************************************************

      subroutine dpem(x,igrad,u,ug)

      implicit none
      ! number of electronic state
      integer, parameter :: nstates=14
      integer, parameter :: natoms=3
      integer, intent(in) :: igrad
      double precision, intent(in) :: x(natoms,3)
      double precision, intent(out) :: u(nstates,nstates)
      double precision, intent(out) :: ug(nstates,nstates,natoms,3)

      double precision :: v(nstates), tx(natoms,3), tg(nstates,3,3)
      double precision :: td(nstates,nstates,3,3)
      double precision :: t(nstates,nstates)

      integer :: iatom, idir, j, istate, jstate
      !initialize 
      u=0.d0
      ug=0.d0

      ! transform from angstrom to bohr
      do iatom=1,natoms
        do idir=1,3
          tx(iatom,idir)=x(iatom,idir)/0.529177211
        enddo
      enddo
      tg=0.d0
      td=0.d0

      call energy_gradient(tx,v,tg,td,t,u,ug,natoms,nstates)

      u=u*27.211386
      ug=ug*51.422067

      end

  subroutine energy_gradient(x,e,g,h,t,u,ug,n,ns)
    ! n    - number of atoms: 3
    ! ns   - number of states: 14
    ! x    - Cartesian coordinates
    ! e    - adiabatic energies
    ! g    - derivatives of adiabatic energies w.r.t. Cartesians
    ! h    - nonadiabatic coupling vectors w.r.t. Cartesians
    ! t    - transformation matrix
    ! r    - internuclear distances
    ! gr   - derivatives of adiabatic energies w.r.t. internuclear
    ! distances
    ! v2b  - two-body energy contributions
    ! g2b  - derivatives of two-body energy contributions w.r.t.
    ! internuclear distances
    ! drdx - dr/dx matrix for converting derivatives

    implicit none
    integer, intent(in) :: n,ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(inout) :: e(ns)
    real*8, intent(inout) :: g(ns,n,3)
    real*8, intent(inout) :: t(ns,ns)
    real*8, intent(inout) :: h(ns,ns,n,3)
    real*8, intent(inout) :: u(ns,ns)
    real*8, intent(inout) :: ug(ns,ns,n,3)

    ! layers and their sizes
    real*8, save :: coeff_l0(3,30), coeff_l1(30,65), coeff_l2(65,95), coeff_l3(95,125), coeff_l4(125,105)
    real*8, save :: bias_l0(30), bias_l1(65), bias_l2(95), bias_l3(125), bias_l4(105)
    real*8 :: r(n*(n-1)/2)
    real*8 :: a
    real*8 :: gr(ns,n*(n-1)/2)
    real*8 :: hr(ns,ns,n*(n-1)/2)
    real*8 :: ur(ns,ns,n*(n-1)/2)
    real*8 :: v2b(ns),g2b(ns,n*(n-1)/2)
    real*8 :: drdx(n*(n-1)/2,3*n)
    integer :: i,j,k,l,m
    logical, save :: first_time_data=.true.

    ! In this version we used the new activation functional 
    ! So DPEM layer becomes:
    ! A(r)*B(r)*dpem_layer
    ! the f,a,b parameters are 2, -2, and 7.5
    ! A(r)=0.5+0.5*tanh(2*(r+2))
    ! B(r)=0.5+0.5*yanh(2*(-x+7.5))
    e=0.d0
    g=0.d0
    h=0.d0

    ! get ddnn coefficients and bias
    if(first_time_data) then
      call assign_coeff_bias(coeff_l0,coeff_l1,coeff_l2,coeff_l3,coeff_l4,bias_l0,bias_l1,bias_l2,bias_l3,bias_l4)
      first_time_data=.false.
    endif
    ! input x is in bohr
    call convert_xyz_to_r(x,r,n)
    ! calculate the two-body terms
    call ev2gm2m(r,v2b,g2b,4,1,n)
    ! forward propagate sfp to energy 
    call backprop(r,n,ns,e,gr,hr,u,ur,t,coeff_l0,coeff_l1,coeff_l2,coeff_l3,&
      &coeff_l4,bias_l0,bias_l1,bias_l2,bias_l3,bias_l4,v2b,g2b)
    ! convert from gradient_r to gradient_xyz
    call grad_r_to_xyz(g,drdx,gr,r,x,n,ns)
    call nac_r_to_xyz(h,drdx,hr,r,x,n,ns)
    call nac_r_to_xyz(ug,drdx,ur,r,x,n,ns)
    ! convert energy from eV to hartree (1/27.2107=0.0367502)
    e(:)=e(:)*0.0367502d0
    u(:,:)=u(:,:)*0.0367502d0
    ! convert grad and nac from eV/bohr to hartree/bohr (1/27.2107=0.0367502)
    g(:,:,:)=g(:,:,:)*0.0367502d0
    ug(:,:,:,:)=ug(:,:,:,:)*0.0367502d0

  endsubroutine energy_gradient

!===========================
! back propagation
  subroutine backprop(r,n,ns,e,g,h,u,ur,t,coeff_l0,coeff_l1,coeff_l2,coeff_l3,&
    &coeff_l4,bias_l0,bias_l1,bias_l2,bias_l3,bias_l4,v2b,g2b)
    implicit none
    integer, intent(in) :: n, ns
    real*8 :: r(n*(n-1)/2)
    real*8, intent(inout) :: e(ns), g(ns,n*(n-1)/2), h(ns,ns,n*(n-1)/2)
    real*8, intent(inout) :: t(ns,ns), u(ns,ns), ur(ns,ns,n*(n-1)/2)
    real*8, intent(in) :: coeff_l0(3,30), coeff_l1(30,65), coeff_l2(65,95), coeff_l3(95,125), coeff_l4(125,105)
    real*8, intent(in) :: bias_l0(30), bias_l1(65), bias_l2(95), bias_l3(125), bias_l4(105)

    real*8 :: a0(30), a1(65), a2(95), a3(125), a4(105)
    real*8 :: z0(30), z1(65), z2(95), z3(125), z4(105)
    real*8 :: g0(3,30), g1(3,65), g2(3,95), g3(3,125), g4(3,105), g4p(105,3)
    real*8 :: dpem(ns,ns), dvdu(ns,105)
    real*8 :: dudr(ns,ns,3), tmpmat(ns,ns)

    integer :: sum1
    integer :: i,j,k,l

    real*8 :: v2b(ns),g2b(ns,n*(n-1)/2)

    a0=0.0d0
    a1=0.0d0
    a2=0.0d0
    a3=0.0d0
    a4=0.0d0
    z0=0.0d0
    z1=0.0d0
    z2=0.0d0
    z3=0.0d0
    z4=0.0d0

    e=0.0d0
    g0=0.0d0
    g1=0.0d0
    g2=0.0d0
    g3=0.0d0
    g4=0.0d0

    call mproduct(r,coeff_l0,z0,1,3,30)
    z0=z0 !+bias_l0
    call activation_gelu(z0,a0,30)

    call mproduct(a0,coeff_l1,z1,1,30,65)
    z1=z1 !+bias_l1
    call activation_gelu(z1,a1,65)

    call mproduct(a1,coeff_l2,z2,1,65,95)
    z2=z2 !+bias_l2
    call activation_gelu(z2,a2,95)
    
    call mproduct(a2,coeff_l3,z3,1,95,125)
    z3=z3 !+bias_l3
    call activation_gelu(z3,a3,125)

    !diabatic layer, use activation functional 
    call mproduct(a3,coeff_l4,z4,1,125,105)
    z4=z4 !+bias_l4
    call activation_functional_heviside(z4,a4,105,r,n*(n-1)/2)

    !construction many-body diabatic potential energy matrix (mb-dpem)
    do i=1,ns
      dpem(i,i)=a4(i)
    enddo
    do i=1,ns
      do j=i+1,ns
        call sumover(ns,i,sum1)
        k=ns-1+sum1+j-i
        dpem(i,j)=a4(k)
        dpem(j,i)=dpem(i,j)
      enddo
    enddo

    !adding the two-body terms to mb-dpem
    do i=1,ns
      dpem(i,i)=dpem(i,i) + v2b(i)
    enddo

    u=dpem

    ! diagonalize dpem
    call diagonalize(ns,dpem,e,t)

    ! cmpute dvdu 
    do i=1,ns
      do j=1,ns
        dvdu(i,j)=t(j,i)*t(j,i)
      enddo
    enddo 
    do i=1,ns
      do j=1,ns
        do k=j+1,ns
          call sumover(ns,j,sum1)
          l=ns-1+sum1+k-j
          dvdu(i,l)=2.0*t(j,i)*t(k,i)
        enddo
      enddo
    enddo 

   ! compute gradients 
   g0=coeff_l0   
   do i=1,3
     call activation_derivative_gelu(z0, a0, g0(i,:), 30)
   enddo 

   call mproduct(g0,coeff_l1,g1,3,30,65)

   do i=1,3
     call activation_derivative_gelu(z1, a1, g1(i,:), 65)
   enddo   

   call mproduct(g1,coeff_l2,g2,3,65,95)
   do i=1,3
     call activation_derivative_gelu(z2, a2, g2(i,:), 95)
   enddo

   call mproduct(g2,coeff_l3,g3,3,95,125)
   do i=1,3
     call activation_derivative_gelu(z3, a3, g3(i,:), 125)
   enddo 

   call mproduct(g3,coeff_l4,g4,3,125,105)
   ! here to add actional functional derivative
   call activation_functional_derivative_terms(g4,z4,105,r,n*(n-1)/2)

   do i=1,3
     do j=1,105
       g4p(j,i)=g4(i,j)
     enddo
   enddo 
 
   do i=1,ns
     do j=1,3
     g4p(i,j) = g4p(i,j) + g2b(i,j)
     enddo
   enddo

   call mproduct(dvdu,g4p,g,ns,105,3)

   ! compute NACs
   ! g4p is the DPEM gradients 
   dudr(:,:,:)=0.d0
   do i=1,ns
     dudr(i,i,:)=g4p(i,:)
   enddo
   do i=1,ns
     do j=i+1,ns
        call sumover(ns,i,sum1)
        k=ns-1+sum1+j-i
        dudr(i,j,:)=g4p(k,:)
        dudr(j,i,:)=dudr(i,j,:)
     enddo
   enddo

   ur=dudr

   h(:,:,:)=0.d0
   do i=1,3
     tmpmat(:,:)=dudr(:,:,i)
     ! C^T*dU*C
     tmpmat=matmul(transpose(t), matmul(tmpmat,t))
     ! F_ij = (C^T*dU*C)_ij / (V_j-V_i)
     do j=1,ns
       do k=j+1,ns
         if ((e(k)-e(j)) > 1.d-8) then
           h(j,k,i)=tmpmat(j,k)/(e(k)-e(j))
         else
           h(j,k,i)=tmpmat(j,k)/1.d-8
         endif
         h(k,j,i)=-h(j,k,i)
       enddo
     enddo
   enddo

  endsubroutine backprop

!=========================
!activation function, gelu
  subroutine activation_gelu(z, a, n)
    integer i,n
    real*8, intent(in) :: z(n)
    real*8, intent(inout) :: a(n)

    do i=1,n
      a(i)=0.5*z(i)*(1+erf(z(i)/sqrt(2.d0)))
    enddo

  end subroutine activation_gelu

  subroutine activation_derivative_gelu(z, a, b, n)
    integer i,n
    real*8, intent(in) :: z(n), a(n)
    real*8, intent(inout) :: b(n)

    do i=1,n
!     b(i)=b(i)*(0.5*erf(z(i)/sqrt(2.d0))+0.398942*exp(-z(i)**2/2)*z(i)+0.5)
      b(i)=b(i)*(a(i)/z(i) + 0.398942*z(i)*exp(-z(i)**2/2) )
    enddo

  end subroutine activation_derivative_gelu

!=============================
!activation functional heviside
! A(r)*B(r)*dpem_layer
! the f,a,b parameters are 2, -2, and 7.5
! A(r)=0.5+0.5*tanh(2*(r+2))
! B(r)=0.5+0.5*tanh(2*(-x+7.5))
  subroutine activation_functional_heviside(z, a, n, r, nbonds)
    integer, intent(in) :: n, nbonds
    real*8, intent(in) :: z(n)
    real*8, intent(in) :: r(nbonds)
    real*8, intent(inout) :: a(n)
    real*8 :: r2(nbonds)
    real*8 :: r_max, Ar, Br
    integer :: max_pos
    real*8, parameter :: af_f=0.6, af_a=-2, af_b=7.0

    integer :: i

    r2=r
    max_pos=maxloc(r2,dim=1)
    r2(max_pos)=-1.0
    r_max=maxval(r2,nbonds)

    Ar=0.5+0.5*tanh(af_f*(r_max-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_max+af_b))
    do i=1,n
      a(i)=Ar*Br*z(i)
    enddo

  end subroutine activation_functional_heviside

!=============================
!add activation functional derivative terms
!call activation_functional_derivative_terms(g4,21,n*(n-1)/2,z4)
  subroutine activation_functional_derivative_terms(g, z, n, r, nbonds)
    integer, intent(in) :: n, nbonds
    real*8, intent(in) :: z(n)
    real*8, intent(in) :: r(nbonds)
    real*8, intent(inout) :: g(nbonds,n)

    real*8 :: r2(nbonds)
    real*8 :: r_max
    integer :: max_pos
    real*8 :: Ar, Br
    real*8, parameter :: af_f=0.6, af_a=-2, af_b=7.0
    real*8 :: dfdr(nbonds)

    integer :: i

    r2=r
    max_pos=maxloc(r2,dim=1)
    r2(max_pos)=-1.0
    r_max=maxval(r2,nbonds)

    Ar=0.5+0.5*tanh(af_f*(r_max-af_a))
    Br=0.5+0.5*tanh(af_f*(-r_max+af_b))

    ! r(2)<=r(1)<=r(3)
    if (r(1).ge.r(2) .and. r(1).le.r(3)) then
      dfdr(1)=(0.5+(0.5*sinh(15.0-2*r(1)))/cosh(15.0-2*r(1)))/(cosh(2.0*r(1)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(1)+4.0))/(cosh(2.0*r(1)+4.0)))/((cosh(15.0-2*r(1)))**2)
      !dfdr(1)=-(4.0*exp(4.0*r(1)+46.0)*(exp(8.0*r(1)-exp(22.0))))/((exp(4.0*r(1)+exp(30.0)))**2)/((exp(4.0*r(1)+8.0)+1.0)**2)
    else
      dfdr(1)=0.d0
    endif

    ! r(3)<=r(1)<=r(2)
    if (r(1).le.r(2) .and. r(1).ge.r(3)) then
      dfdr(1)=(0.5+(0.5*sinh(15.0-2*r(1)))/cosh(15.0-2*r(1)))/(cosh(2.0*r(1)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(1)+4.0))/(cosh(2.0*r(1)+4.0)))/((cosh(15.0-2*r(1)))**2)
      !dfdr(1)=-(4.0*exp(4.0*r(1)+46.0)*(exp(8.0*r(1)-exp(22.0))))/((exp(4.0*r(1)+exp(30.0)))**2)/((exp(4.0*r(1)+8.0)+1.0)**2)
    else
      dfdr(1)=0.d0
    endif

    ! r(1)<=r(2)<=r(3)
    if (r(2).ge.r(1) .and. r(2).le.r(3)) then
      dfdr(2)=(0.5+(0.5*sinh(15.0-2*r(2)))/cosh(15.0-2*r(2)))/(cosh(2.0*r(2)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(2)+4.0))/(cosh(2.0*r(2)+4.0)))/((cosh(15.0-2*r(2)))**2)
      !dfdr(2)=-(4.0*exp(4.0*r(2)+46.0)*(exp(8.0*r(2)-exp(22.0))))/((exp(4.0*r(2)+exp(30.0)))**2)/((exp(4.0*r(2)+8.0)+1.0)**2)
    else
      dfdr(2)=0.d0
    endif

    ! r(3)<=r(2)<=r(1)
    if (r(2).ge.r(1) .and. r(2).le.r(3)) then
      dfdr(2)=(0.5+(0.5*sinh(15.0-2*r(2)))/cosh(15.0-2*r(2)))/(cosh(2.0*r(2)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(2)+4.0))/(cosh(2.0*r(2)+4.0)))/((cosh(15.0-2*r(2)))**2)
      !dfdr(2)=-(4.0*exp(4.0*r(2)+46.0)*(exp(8.0*r(2)-exp(22.0))))/((exp(4.0*r(2)+exp(30.0)))**2)/((exp(4.0*r(2)+8.0)+1.0)**2)
    else
      dfdr(2)=0.d0
    endif

    ! r(2)<=r(3)<=r(1)
    if (r(3).ge.r(2) .and. r(3).le.r(1)) then
      dfdr(3)=(0.5+(0.5*sinh(15.0-2*r(3)))/cosh(15.0-2*r(3)))/(cosh(2.0*r(3)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(3)+4.0))/(cosh(2.0*r(3)+4.0)))/((cosh(15.0-2*r(3)))**2)
      !dfdr(3)=-(4.0*exp(4.0*r(3)+46.0)*(exp(8.0*r(3)-exp(22.0))))/((exp(4.0*r(3)+exp(30.0)))**2)/((exp(4.0*r(3)+8.0)+1.0)**2)
    else
      dfdr(3)=0.d0
    endif

    ! r(1)<=r(3)<=r(2)
    if (r(3).le.r(2) .and. r(3).ge.r(1)) then
      dfdr(3)=(0.5+(0.5*sinh(15.0-2*r(3)))/cosh(15.0-2*r(3)))/(cosh(2.0*r(3)+4.0)**2) +&
        &(-0.5-(0.5*sinh(2.0*r(3)+4.0))/(cosh(2.0*r(3)+4.0)))/((cosh(15.0-2*r(3)))**2)
      !dfdr(3)=-(4.0*exp(4.0*r(3)+46.0)*(exp(8.0*r(3)-exp(22.0))))/((exp(4.0*r(3)+exp(30.0)))**2)/((exp(4.0*r(3)+8.0)+1.0)**2)
    else
      dfdr(3)=0.d0
    endif


    do i=1,nbonds
      g(i,:)=dfdr(i)*z(:)+Ar*Br*g(i,:)
    enddo

  end subroutine activation_functional_derivative_terms

!==============================
! used to compute index in DPEM
  subroutine sumover(a,b,sum1)
    integer, intent(in) :: a, b
    integer, intent(out) :: sum1
    integer :: num

    sum1=1-a
    do num=a, a-b+1, -1
      sum1=sum1+num
    enddo
  end subroutine sumover

!==============================
! matrix diagonalization
! subroutine diagonalize(n,A_ss,B_ss,U_ss)
  subroutine diagonalize(n,A_ss,EV_s,U_ss)
    implicit none
    ! parameters
    integer, intent(in) :: n
    real*8, intent(in) :: A_ss(n,n)
!   real*8, intent(out) :: B_ss(n,n)
    real*8, intent(out) :: U_ss(n,n)
    ! internal variables
!   real*8 :: EV_s(n)
    real*8, intent(out) :: EV_s(n)
    integer :: io,i
    real*8,allocatable :: lapack_work_d(:)
    integer, save :: lapack_lwork_d 
    logical, save :: first_time_diag=.true.

    U_ss=A_ss
    if (first_time_diag) then
      lapack_lwork_d= -1
      allocate( lapack_work_d(2) )
      call dsyev('V','L',n,U_ss,n,EV_s,lapack_work_d,lapack_lwork_d,io)
      lapack_lwork_d=int(lapack_work_d(1))
      deallocate ( lapack_work_d )
      first_time_diag=.false.
    endif
    allocate( lapack_work_d(lapack_lwork_d) )
    call dsyev('V','L',n,U_ss,n,EV_s,lapack_work_d,lapack_lwork_d,io)
    ! U_ss already holds the transformation matrix
    ! now  building the diagonal matrix A_ss
!   B_ss=0.d0
!   do i=1,n
!     B_ss(i,i)=EV_s(i)
!   enddo

    return

  end subroutine diagonalize

!==========================
! convert de/dr to de/dxyz
  subroutine grad_r_to_xyz(g,drdx,gr,r,x,n,ns)
    implicit none
    integer, intent(in) :: n, ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(in) :: r(n*(n-1)/2)
    real*8, intent(in) :: gr(ns,n*(n-1)/2)
    real*8, intent(inout) :: g(ns,n,3)
    real*8, intent(inout) :: drdx(n*(n-1)/2,3*n)

    real*8 ::  gx(ns,3*n)
    integer :: i,j

    drdx=0.0d0

    ! compute drdx
    drdx(1,1)=(x(1,1)-x(2,1))/r(1)
    drdx(1,2)=(x(1,2)-x(2,2))/r(1)
    drdx(1,3)=(x(1,3)-x(2,3))/r(1)
    drdx(1,4)=-drdx(1,1)
    drdx(1,5)=-drdx(1,2)
    drdx(1,6)=-drdx(1,3)
    drdx(2,1)=(x(1,1)-x(3,1))/r(2)
    drdx(2,2)=(x(1,2)-x(3,2))/r(2)
    drdx(2,3)=(x(1,3)-x(3,3))/r(2)
    drdx(2,7)=-drdx(2,1)
    drdx(2,8)=-drdx(2,2)
    drdx(2,9)=-drdx(2,3)
    drdx(3,4)=(x(2,1)-x(3,1))/r(3)
    drdx(3,5)=(x(2,2)-x(3,2))/r(3)
    drdx(3,6)=(x(2,3)-x(3,3))/r(3)
    drdx(3,7)=-drdx(3,4)
    drdx(3,8)=-drdx(3,5)
    drdx(3,9)=-drdx(3,6)

    call mproduct(gr,drdx,gx,ns,n*(n-1)/2,3*n)

    do i=1,n
      g(:,i,1)=gx(:,3*(i-1)+1)
      g(:,i,2)=gx(:,3*(i-1)+2)
      g(:,i,3)=gx(:,3*(i-1)+3)
    enddo 

  end subroutine grad_r_to_xyz

!==========================
! convert d/dr to d/dxyz for NAC
  subroutine nac_r_to_xyz(h,drdx,hr,r,x,n,ns)
    implicit none
    integer, intent(in) :: n, ns
    real*8, intent(in) :: x(n,3)
    real*8, intent(in) :: r(n*(n-1)/2)
    real*8, intent(in) :: hr(ns,ns,n*(n-1)/2)
    real*8, intent(inout) :: h(ns,ns,n,3)
    real*8, intent(inout) :: drdx(n*(n-1)/2,3*n)

    real*8 ::  hr_vec(ns*ns,n*(n-1)/2)
    real*8 ::  hx(ns*ns,3*n)

    integer :: i,j,k,l

    drdx=0.0d0

    ! compute drdx
    drdx(1,1)=(x(1,1)-x(2,1))/r(1)
    drdx(1,2)=(x(1,2)-x(2,2))/r(1)
    drdx(1,3)=(x(1,3)-x(2,3))/r(1)
    drdx(1,4)=-drdx(1,1)
    drdx(1,5)=-drdx(1,2)
    drdx(1,6)=-drdx(1,3)
    drdx(2,1)=(x(1,1)-x(3,1))/r(2)
    drdx(2,2)=(x(1,2)-x(3,2))/r(2)
    drdx(2,3)=(x(1,3)-x(3,3))/r(2)
    drdx(2,7)=-drdx(2,1)
    drdx(2,8)=-drdx(2,2)
    drdx(2,9)=-drdx(2,3)
    drdx(3,4)=(x(2,1)-x(3,1))/r(3)
    drdx(3,5)=(x(2,2)-x(3,2))/r(3)
    drdx(3,6)=(x(2,3)-x(3,3))/r(3)
    drdx(3,7)=-drdx(3,4)
    drdx(3,8)=-drdx(3,5)
    drdx(3,9)=-drdx(3,6)

    do i=1,ns
      do j=1,ns
        k=(i-1)*ns+j
        hr_vec(k,:)=hr(i,j,:)
      enddo
    enddo
    call mproduct(hr_vec,drdx,hx,ns*ns,n*(n-1)/2,3*n)

    do i=1,n
      do j=1,ns
        do k=1,ns
          l=(j-1)*ns+k
          h(j,k,i,1)=hx(l,3*(i-1)+1)
          h(j,k,i,2)=hx(l,3*(i-1)+2)
          h(j,k,i,3)=hx(l,3*(i-1)+3)
        enddo
      enddo
    enddo

  end subroutine nac_r_to_xyz

!==========================
! convert xyz to r
  subroutine convert_xyz_to_r(x,r,n)
    implicit none
    integer, intent(in) :: n
    real*8, intent(in) :: x(n,3)
    real*8, intent(out) :: r(n*(n-1)/2)
    integer :: i, j, l

    l=1
    !pairs of distances
    do i=1,n
      do j=i+1,n
        r(l)=sqrt((x(i,1)-x(j,1))**2+(x(i,2)-x(j,2))**2+(x(i,3)-x(j,3))**2)
        l=l+1
      enddo
    enddo

  endsubroutine convert_xyz_to_r

!=========================
! matrix vector product 
  subroutine mproduct(a,b,c,l,m,n)
    implicit none
    integer, intent(in) :: l, m, n
    real*8, intent(in) :: a(l,m), b(m,n)
    real*8, intent(inout) :: c(l,n)

    integer :: i, j, k
  
    do i=1,l
      do j=1,n
        c(i,j)=0.d0
        do k=1,m
          c(i,j)=c(i,j)+a(i,k)*b(k,j)
        enddo
      enddo
    enddo
    
    return
  endsubroutine mproduct

