      subroutine ev2gm2m(dist,v2b,g2b,imol,igrad,n)

      implicit none

      integer,intent(in) :: imol, igrad
      integer,intent(in) :: n
      double precision,intent(in)  :: dist(n*(n-1)/2)
      double precision,intent(out) :: v2b(14), g2b(14,3)
      double precision :: v(14), grad(14)
      double precision :: r
      integer :: i,j

      ! dist should be in bohr
      ! it is converted to be r in Ang
      ! v2b is in eV
      ! grad2b is in eV/bohr

      ! V0 is 120.17443 kcal/mol
      v2b = 120.17443d0/23.061d0
      g2b = 0.0d0
      do i=1,n*(n-1)/2
        r=dist(i)*0.529177d0
        call ev2gm2(r,v,grad,imol,igrad)
        v2b = v2b + v/23.061d0
        if (igrad.eq.1) then
          do j=1,14
            g2b(j,i) = grad(j)/(23.061d0/0.529177d0)
          enddo
        endif
      enddo

      end subroutine ev2gm2m

      subroutine ev2gm2(r,v,grad,imol,igrad) 
!**********************************************************************
!
! Compute the diatomic potential of groupd-state triplet O2
!
! References: J. Chem. Phys. 132, 074307 (2010)
!
! Input:  r      interatomic distance in Angstrom
! Output: V      potential in kcal/mol
!         grad   gradient (kcal/mol)/Angstrom
!
!**********************************************************************
      implicit none

      integer,intent(in) :: imol, igrad
      double precision,intent(in)  :: r
      double precision,intent(out) :: v(14), grad(14)
! Parameters of analytical even-tempered Gaussian expansions for the
! ground state potential energy curve of O2 CBS+SR+SO+CV.
! Units: alpha in Angstrom^-2, beta=dimensionless, as_k in milihartree.
      double precision :: alpha,beta,as(0:7)
      double precision :: gam, del
      integer :: i,j,k 
! Dispersion variables
      double precision :: dist(1),disp,dispdr(1)

      v=0.0d0
      grad=0.0d0

! list of considered states in 3A' symmetry
! V(1) - O2(3Sig_g^-) + O(3P)
! V(2) - O2(3Sig_g^-) + O(3P)
! V(3) - O2(3Del_u)   + O(3P)
! V(4) - O2(3Del_u)   + O(3P)
! V(5) - O2(3Del_u)   + O(3P)
! V(6) - O2(3Sig_u^+) + O(3P)


! Calculate dispersion correction for all states
        dist(1)=r
        call d3disp(dist,disp,dispdr,1,imol)

      do i=1,14
      if ((i.eq.1).or.(i.eq.2)) then
      ! Original parameters
      !      alpha = 0.785d0
      !      beta = 1.307d0
      !      as(0) = -2388.5641690d0
      !      as(1) = 18086.977116d0
      !      as(2) = -71760.197585d0
      !      as(3) = 154738.09175d0
      !      as(4) = -215074.85646d0
      !      as(5) = 214799.54567d0
      !      as(6) = -148395.42850d0
      !      as(7) = 73310.781453d0

      ! O2 X 3Sig_g^-
      ! Modified parameters for D3(BJ)
       alpha =  9.91088352d-1
       beta =   1.35561616d0
       as(0) =  1.02827423d3
       as(1) = -1.04225661d4
       as(2) =  2.62510588d4
       as(3) = -3.57598376d4
       as(4) =  3.45354087d4
       as(5) = -1.54421054d4
       as(6) =  5.10053268d3
       as(7) =  1.52168614d4
      else if ((i.eq.3).or.(i.eq.4).or.(i.eq.5)) then
      ! O2 a 1Del_g
       alpha =  0.926743129655067d0
       beta =   1.49310094503326d0
       as(0) = -306.73487963d0
       as(1) = -1390.05533975d0
       as(2) =  4128.81576751d0
       as(3) = -4290.68553855d0
       as(4) =  11743.6159167d0
       as(5) = -4286.12400273d0
       as(6) =  21029.43435387d0
       as(7) =  1807.06950125d0
      else if (i.eq.6) then
      ! O2 b 1Sig_g^+
       alpha =  0.859772042751452d0
       beta =   1.52376335851761d0
       as(0) = -191.49156299d0
       as(1) = -971.3168522d0
       as(2) =  2222.1876317d0
       as(3) = -885.28321436d0
       as(4) =  7119.87096329d0
       as(5) =  2330.45304051d0
       as(6) =  14359.28824246d0
       as(7) =  10675.50993141d0
      else if ((i.eq.7).or.(i.eq.8)) then
       ! mixed energy curve
       alpha =  2.19185728150371d0
       beta =   1.05793185102898d0
       as(0) = -2663791.40882274d0
       as(1) =  4890643.13480523d0
       as(2) =  18211797.6008347d0
       as(3) = -69478406.8831105d0
       as(4) =  88925293.4564620d0
       as(5) = -48996476.3149754d0
       as(6) =  7263885.80760647d0
       as(7) =  1859624.51906546d0
       gam = 15.5242851149696d0
       del = 39.7454754114259d0
      else if ((i.eq.9).or.(i.eq.10)) then
      ! O2 c 1Sig_u^-
       alpha =  0.950046799307d0
       beta =   1.642688451339d0
       as(0) = -483.125326d0
       as(1) =  956.00518d0
       as(2) =  1684.94566d0
       as(3) =  2347.10958d0
       as(4) =  18401.7933d0
       as(5) = -49552.6652d0
       as(6) = -367905.919d0
       as(7) =  47140027.3d0
      else if ((i.eq.11).or.(i.eq.12).or.(i.eq.13)) then
      ! O2 C 3Del_u
       alpha =  1.11399797348271d0
       beta =   1.63184883563828d0
       as(0) = -767.018283d0
       as(1) =  2893.42549d0
       as(2) = -3964.21584d0
       as(3) =  32389.5668d0
       as(4) = -203511.939d0
       as(5) =  2627822.41d0
       as(6) = -68125724.3d0
       as(7) =  4210349180d0
      else if (i.eq.14) then
      ! O2 A 3Sig_u^+
       alpha =  1.24888948675275d0
       beta =   1.61630730207906d0
       as(0) = -866.519522d0
       as(1) =  3532.65087d0
       as(2) = -2927.82317d0
       as(3) =  23357.3166d0
       as(4) = -113057.808d0
       as(5) =  1880718.34d0
       as(6) = -73167704.6d0
       as(7) =  6245674420d0
      endif

      do k=0,7
       v(i)= v(i) + as(k)*dexp(-alpha*beta**k*r**2)
      enddo
      if ((i.eq.7).or.(i.eq.8)) then
       v(i)= v(i) + gam*dexp(-del*(r-1.7d0)**2)
      endif
      !if ((i.eq.1).or.(i.eq.2)) then
! From milihartree to kcal/mol
       !v(i)=v(i)*627.509523475149d-3
      !endif

! Add D3 dispersion correction
        v(i)=v(i)+disp

! Compute the gradient if needed
      if (igrad.eq.1) then
       do k=0,7
        grad(i)=grad(i)-2.d0*as(k)*alpha*beta**k*r*dexp(-alpha*beta**k*r**2)
       enddo
       if ((i.eq.7).or.(i.eq.8)) then
        grad(i)=grad(i)-2.0d0*del*gam*(r-1.7d0)*dexp(-del*(r-1.7d0)**2)
       endif
       !if ((i.eq.1).or.(i.eq.2)) then
! Convert from milihartree/A to (kcal/mol)/A
        !grad(i)=grad(i)*627.509523475149d-3
       !endif
        grad(i)= grad(i) + dispdr(1)
      endif

      enddo

      return
      end subroutine ev2gm2

      subroutine d3disp(dist,disp,dispdr,igrad,imol)
!**********************************************************************
! Dispersion correction based on Grimme's D3(BJ) calculation for
! diatomic pairs
!
! Several subroutines of DFTD3 V3.1 Rev 1 by Grimme were merged into 
! subroutine edisp and they have been heavily modified to calculate only
! that dispersion energy correction that is needed.
!
! S. Grimme, J. Antony, S. Ehrlich and H. Krieg
! J. Chem. Phys, 132 (2010), 154104
! and 
! S. Grimme, S. Ehrlich and L. Goerigk, J. Comput. Chem, 32 (2011),
! 1456-1465
!
! The C6 values are fixed.
!
!**********************************************************************

      double precision cn(2),s6,s8,rs6,rs8
      double precision dist(1), e6(1), e8(1), disp, dispdr(1), c6(2)
      double precision e6dr(1),e8dr(1)
      integer iz(2), mxc(94), i, j, igrad
      double precision c6ab(94,94,5,5,3)
      double precision r2r4(94)
      double precision autoang,autokcal
      integer imol

      autoang =0.52917726d0
      autokcal=627.509541d0

! Generalized parameters for BJ damping from P. Verma, B. Wang, 
! L. E. Fernandez, and D. G. Truhlar, J. Phys. Chem. A 121, 2855 (2017)
      s6= 1.0d0
      s8= 2.0d0
      rs6= 0.5299d0
      rs8= 2.20d0

      do i=1,1
      dist(i)=dist(i)/autoang
      enddo

      if (imol.eq.4) then
! iz for O2 system
      iz(1)=8
      iz(2)=8

! C6 for O2 system
      c6(1)=12.8d0
      c6(2)=12.8d0
      else
! currently imol = 4 is used
      stop
      endif

! Calculate dispersion correction
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,0)

      disp = 0.0d0

      do i=1,1
      disp =disp + (-s6*e6(i)-s8*e8(i))*autokcal
      enddo

      if (igrad .eq. 1) then
      call edisp(94,5,2,dist,iz,mxc, &
           rs6,rs8,e6,e8,e6dr,e8dr,c6,1)

      dispdr(:) = 0.0d0

      do i=1,1
      dispdr(i) =dispdr(i) + (-s6*e6dr(i)-s8*e8dr(i))*autokcal/autoang
      enddo
      endif

      do i=1,1
      dist(i)=dist(i)*autoang
      enddo

      end subroutine d3disp

!**********************************************************************
! compute energy
!**********************************************************************
      subroutine edisp(max_elem,maxc,n,dist,iz,mxc, &
                 rs6,rs8,e6,e8,e6dr,e8dr,c6a,igrad)

      integer n,iz(2),max_elem,maxc,mxc(max_elem) 
      double precision dist(1),r2r4(max_elem),r0ab(max_elem,max_elem)
      double precision rs6,rs8,rcov(max_elem)
      double precision c6ab(max_elem,max_elem,maxc,maxc,3)
      double precision e6(1), e8(1), c6a(2), e6dr(1), e8dr(1)
       
      integer iat,jat,igrad
      double precision r,tmp,c6,c8,a1,a2
      double precision damp6,damp8
      double precision cn(n)
      double precision r2ab(n*n),cc6ab(n*n),dmp(n*n)
      integer step

      e6(:) =0.0d0
      e8(:) =0.0d0

      e6dr(:) =0.0d0
      e8dr(:) =0.0d0

      a1=rs6
      a2=rs8 

!  r2r4 =sqrt(0.5*r2r4(i)*dfloat(i)**0.5 ) with i=elementnumber
!  the large number of digits is just to keep the results consistent
!  with older versions. They should not imply any higher accuracy than
!  the old values
      r2r4(1:94)=(/ &
      2.00734898d0,  1.56637132d0,  5.01986934d0,  3.85379032d0, &
      3.64446594d0,  3.10492822d0,  2.71175247d0,  2.59361680d0, &
      2.38825250d0,  2.21522516d0,  6.58585536d0,  5.46295967d0, &
      5.65216669d0,  4.88284902d0,  4.29727576d0,  4.04108902d0, &
      3.72932356d0,  3.44677275d0,  7.97762753d0,  7.07623947d0, &
      6.60844053d0,  6.28791364d0,  6.07728703d0,  5.54643096d0, &
      5.80491167d0,  5.58415602d0,  5.41374528d0,  5.28497229d0, &
      5.22592821d0,  5.09817141d0,  6.12149689d0,  5.54083734d0, &
      5.06696878d0,  4.87005108d0,  4.59089647d0,  4.31176304d0, &
      9.55461698d0,  8.67396077d0,  7.97210197d0,  7.43439917d0, &
      6.58711862d0,  6.19536215d0,  6.01517290d0,  5.81623410d0, &
